import React from 'react';
import ReactDOM from 'react-dom';
import { createServer } from 'miragejs'
import {App} from './App';

createServer({
  routes() {
    this.namespace = 'api';

    this.get('/transactions', () => {
      return [
        {
          id: 1,
          title: 'Transaction 1',
          amount: 400,
          type: 'deposit',
          category: 'Food',
          createdAt: new Date(),
        }
      ]
    })
  }
})

ReactDOM.render(
  <>
    <App />
  </>,
  document.getElementById('root')
);
